import React, { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';

const FacultyProfileDetails = () => {
    const [facultyData, setFacultyData] = useState(null);
    const { username } = useParams();

    useEffect(() => {
        fetch(`http://localhost:3001/api/faculty/${username}`)
            .then(response => {
                if (!response.ok) {
                    throw new Error('Network response was not ok');
                }
                return response.json();
            })
            .then(data => {
                setFacultyData(data);
            })
            .catch(error => {
                console.error('Fetch error:', error);
            });
    }, [username]); // Dependency array to re-run effect if username changes

    if (!facultyData) {
        return <div>Loading...</div>;
    }

    // Render faculty data
    return (
        <div>
            <h2>{facultyData.name}</h2>
            {/* Render other faculty details */}
        </div>
    );
};

export default FacultyProfileDetails;
